import {React, useState, useEffect} from 'react';
import './LanguageList.css';
import arrow from '../../images/icon-dropdown.svg'


export default function LanguageList(props){

    const languages = [
        {title:'PORTUGUES'},
        {title:'INGLES'},
        {title:'FRANCES'},
        {title:'ALEMAO'},
        {title:'CHINES'},
      ]

      const languageList = languages.map(language=>{
        return (
          <div className='language-item'>
          <img className='arrow-image' src={arrow} alt='arrow' key='arrow'/>
          <p>{language.title}</p>
         </div>
        )
    });

    return(
     <ul className = 'language-container'>
        {languageList}
      </ul>
    )

}
